import toggle from '../../assets/toggle.png';
import React, { useState } from 'react';
import Button from 'react-bootstrap/Button';
import Offcanvas from 'react-bootstrap/Offcanvas';
import classes from './MainNavigation.module.css';

function SideMenu() {
    const [show, setShow] = useState(false);
  
    const handleClose = () => setShow(false);
    const handleShow = () => setShow(true);
  
    return (
      <>
        <Button className={classes.toggle} onClick={handleShow}>
          <img src={toggle}/>
        </Button>

        <Offcanvas className={classes.Offcanvas} show={show} onHide={handleClose} >
          <Offcanvas.Header closeButton>
            <Offcanvas.Title>Offcanvas</Offcanvas.Title>
          </Offcanvas.Header>
          <Offcanvas.Body>
            Some text as placeholder. In real life you can have the elements you
            have chosen. Like, text, images, lists, etc.
          </Offcanvas.Body>
        </Offcanvas>
      </>
    );
  }
  

const MainNavigation = () => {
    return (
        <header className={classes.header}>
            <SideMenu/>
            <h3 className={classes.title}>Website Name</h3>

            <div className={classes.score}><span>200</span> Coins</div>
        </header>
    )
}

export default MainNavigation;
